# process-mrva-results 0.0.1
extensions:
- addsTo:
    extensible: typeModel
    pack: codeql/python-all
  data:
  - - flask.Flask~Subclass
    - prometheus_flask_exporter
    - Member[Flask]
  - - flask.MethodView~Subclass
    - prometheus_flask_exporter
    - Member[MethodView]
  - - flask.Response~Subclass
    - prometheus_flask_exporter
    - Member[Response]
